import './App.css';
import React from 'react';
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from './component/Home';
import List from './component/List';


const App = ()=> {
    return (
      <Routes>
      <Router>
      <div className='app'>
        <h1>App</h1>
        </div>
        <Route path='/' coomponent={<Home/>}/>
        <Route path='/list' coomponent={<List/>}/>
        </Router>
        </Routes>
    );
}

export default App;
